id: 2e9ce00f-112b-43c1-9606-b08c98c4ce86
name: Katharine Hepburn’S Brownies
servings: 12 brownies
source: New York Times Cookbook
source_url: https://cooking.nytimes.com/recipes/10782-katharine-hepburns-brownies
prep_time: 5 minutes
cook_time: 40 minutes
categories: [cookies, dessert, bakery]
notes: |
  Much like its author, this recipe is a no-fuss classic. It calls for just 1/4 cup of flour, which yields an incredibly rich and gooey brownie, and it's super easy to make. So easy, in fact, that baking a batch of these might just become part of your weekend routine.
ingredients: |
  ½ cup cocoa
  1 stick butter
  2 eggs
  1 cup sugar
  ¼ cup flour
  1 cup broken-up walnuts or pecans
  1 teaspoon vanilla
  pinch of salt
directions: |
  Preheat oven to 325 degrees. 
  Melt butter in saucepan with cocoa and stir until smooth. Remove from heat and allow to cool for a few minutes. Whisk in eggs, one at a time. Stir in vanilla. 
  In a separate bowl, combine sugar, flour, nuts, and salt. Add to the cocoa-butter mixture. Stir until just combined. 
  Pour into a greased 8x8 square pan. Bake 40 minutes. Do not overbake; they should be gooey. Let cool, and cut into bars. 
